import React from 'react';
import App from './App';
import {BrowserRouter} from 'react-router-dom';
import CardsData from './CardsData';

// rendering cards from here.............................................................
function ind(){
    return
    <>
    <BrowserRouter>
    <div className="container-fluid">
        <div className="row">
          {CardsData.map(cData)}
        </div>
    </div>
    </BrowserRouter>
    </>
}

  // cards attribute data 
  function cData(val){
    return(
    <>
            <div className="col-xl-3 col-lg-3 col-sm-6 col-xs-12">
              <App image={val.image} title={val.title}/>
            </div>
    </>
    );
    }

export default ind;
